import React from 'react';
import css from "./Product.css";

const Product = (props) => {
    const { product } = props;

    return (
        <div className="col-xs-12 col-sm-12 col-md-6 col-lg-4">
            <img src={product.image}
                alt={product.title}
                className="product__img" />
            {product.title}
        </div>
    )
}

export default Product
